import React from 'react';
import Icon from 'react-native-vector-icons/Feather';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity} from 'react-native';
import {status} from './list';
import {ads} from './list';
import {products} from './list';
import styled from 'styled-components/native';



const Industry= styled.Text`
  
		color:#C3AD60;
		font-family: Roboto; 
		font-weight: 400;
		font-size: 15px; 
		line-height:21.09px; 
		margin-left:20px;
`;


const StyledCart= styled.Image`
		width: 25px;
		height: 25px;
		margin-left:20px;
`;

const StyledHamburger= styled.Image`
		width: 25px;
		height: 25px;
		margin-right:20px;
`;


export default function Ecommerce({navigation}){
	return(
		<SafeAreaView style= {styles.container}>
			<View style={styles.vector}>
			<TouchableOpacity onPress={()=>navigation.navigate('Ecommerce6')}>
				<StyledCart source={require('../assets/cart.png')}/>
			</TouchableOpacity>	
				<View style={styles.vectorRight}>
					<Icon name="search" style={{marginRight:30}} size={25} color="#C3AD60" />
					<StyledHamburger source={require('../assets/hamburger.png')}/>
				</View>
			</View>
			<View style={styles.industry}>
				<Industry>Industry</Industry>
				<View>
					<View style={styles.seeAllView}>
					<TouchableOpacity onPress={()=>navigation.navigate('Ecommerce2')}>
						<Text style={styles.seeAll}>See all</Text>
					</TouchableOpacity>	
					</View>
						<FlatList
						data={status}
						horizontal={true}
						keyExtractor={(item, index)=>index.toString()}
						showsHorizontalScrollIndicator={false}
						renderItem={({item, index})=>
							<TouchableOpacity style={styles.imageView} onPress={()=>navigation.navigate('Ecommerce3')}>
							
								<Image source={item} style={styles.image} key={index}/>
								<Text style={styles.brandName}>Brand Name</Text>
								<Text style={styles.km}>70Km away</Text>
							</TouchableOpacity>
						}
						/>
				</View>
			</View>
			<View style={styles.industry}>
			<FlatList
						data={ads}
						horizontal={true}
						keyExtractor={(item, index)=>index.toString()}
						showsHorizontalScrollIndicator={false}
						renderItem={({item, index})=>
							<View style={styles.ad}>
								<Image source={item} key={index} style={styles.imageAd}/>
							</View>
						}
						/>
			</View>			
			
			<View style={{alignItems:'center', justifyContent:'center', flex:1}}>
				<FlatList
						data={products}
						numColumns={3}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww}>
							<TouchableOpacity onPress={()=>navigation.navigate('Ecommerce5', {image:item.image})} style={styles.imageView}>
								<Image source={item.image} style={styles.image} key={index}/>
								<Text style={styles.brandName}>Product Name</Text>
								<Text style={styles.km}>N0.00</Text>
							</TouchableOpacity>	
							</View>
						}
						/>

			</View>
			<TouchableOpacity onPress={()=>navigation.navigate('Ecommerce4')}><Text style={styles.seeAll}>See all</Text></TouchableOpacity>	
		</SafeAreaView>

		)
}
const styles = StyleSheet.create({
	container:{
		flex:1,
		backgroundColor:'#000000',
	},
	industry:{
		height:'30%', 
		justifyContent:'center',

		
	},
	industryText:{
		color:'#C3AD60', 
		fontFamily:'Roboto', 
		fontWeight:'400', 
		fontSize:15, 
		lineHeight:21.09, 
		marginLeft:20
	},
	seeAllView:{
		alignItems:'flex-end', 
		marginRight:20
	},
	seeAll:{
		color:'white',  
		fontSize:12, 
		fontFamily:'Roboto', 
		fontWeight:'700', 
		lineHeight:14,
		marginLeft:20
	},
	brandName:{
		fontSize:17, 
		fontWeight:'400', 
		fontFamily:'Roboto', 
		color:'white', 
		fontSize:10,
	},
	km:{
		color:'#4E4E4E', 
		fontFamily:'Roboto',
		fontSize:10
	},
	input:{
		backgroundColor:'#444444',
		borderColor:'#777777',
		borderRadius:8,
		width:'90%',
		height:'50%'
		
	},	
	inputView:{
		alignItems:'center',
		justifyContent:'center',
		height:'10%'
	},
	image:{
		height:60,
		width:60,
		margin:20,
		borderRadius:17,
	},
	ad:{
		marginTop:15,
		marginBottom:15
	},
	imageView:{
		alignItems:'center',
		justifyContent:'center'
	},
	imageVieww:{
		alignItems:'center',
		justifyContent:'center',
		margin:10,
		padding:0
	},
	vector:{
		flexDirection:'row',
		justifyContent:'space-between',
		height:'10%',
		alignItems:'center'
	},
	vectorRight:{
		flexDirection:'row',
		
	},
	imageAd:{
		width:400,
		marginLeft:5,
		height:'100%',
		resizeMode:'cover',
		resizeMethod:'auto',
		borderRadius:20,
	}


})
